import React from "react";

import "./styles.css";

import HeaderComponent from "../../components/Header";
import BannerComponent from "../../components/Banner";
import FooterComponent from "../../components/Footer";
import ListJobsComponent from "../../components/ListJobs";
// import StartCTAComponent from "../../StartCTA";

const Home = () => {
  return (
    <div>
      <HeaderComponent />

      <BannerComponent />

      {/* <StartCTAComponent /> */}
      <section class="section">
        <div class="container">
          <div class="row justify-content-center">
            <div class="col-lg-7">
              <div class="text-center">
                <h2 class="text-primary mb-4">
                  Browse Our <span class="text-warning fw-bold">5,000+</span>{" "}
                  Latest Jobs
                </h2>
                <p class="text-muted">
                  Post a job to tell us about your project. We'll quickly match
                  you with the right freelancers.
                </p>
                <div className="text-center mt-5 pt-3">
                  <a href="#" className="btn text-white px-4">
                    Ver Todas{" "}
                    <svg
                      xmlns="http://www.w3.org/2000/svg"
                      width="16"
                      height="16"
                      fill="currentColor"
                      className="bi bi-arrow-right"
                      viewBox="0 0 16 16"
                    >
                      <path
                        fill-rule="evenodd"
                        d="M1 8a.5.5 0 0 1 .5-.5h11.793l-3.147-3.146a.5.5 0 0 1 .708-.708l4 4a.5.5 0 0 1 0 .708l-4 4a.5.5 0 0 1-.708-.708L13.293 8.5H1.5A.5.5 0 0 1 1 8"
                      />
                    </svg>
                  </a>
                </div>
              </div>
            </div>
          </div>
        </div>
      </section>

      <ListJobsComponent />

      <FooterComponent />
    </div>
  );
};

export default Home;
